import AnimatedBackground from "./style/AnimatedBackground";
import styled from 'styled-components';
import ShowImages from "./pages/ShowImages";
import { DelayedNavi, useLogout, ChecksToken } from './modules/Hooks';
// import mall from './images/mall.jpg';

function App() {
  const { isLoggedIn } = ChecksToken();
  const triggerNavi = DelayedNavi();
  const { handleLogout } = useLogout();

  const handleButtonClick = () => {
    triggerNavi('/PersonalPage');
  };

  const handlelogin = () => {
    triggerNavi('/login')
  }

  return (
    <>

      {isLoggedIn ? (
        <Container>
          <button onClick={handleLogout}>
            로그아웃
          </button>
          <button onClick={handleButtonClick}>
           개인페이지
          </button>
        </Container>
      ) : (
        <Container>
          <button onClick={handlelogin}>
            <span>로그인</span>
          </button>
        </Container>
      )}
      <AnimatedBackground/>

        <ShowImages />
    </>
  );
}

export default App;

const Container = styled.div`
  display:flex;
  width: 100%;
  height:150px;
`;
